        fieldNames.add(copyField.getSource().getName());
      }
    }
  }
  for (DynamicCopy dynamicCopy : dynamicCopyFields) {
    if (dynamicCopy.getDestFieldName().equals(destField)) {
      fieldNames.add(dynamicCopy.getRegex());
    }
  }
  return fieldNames;
}

